import React, {Component} from 'react';
import UserService from "../../services/UserService";
import StockService from "../../services/StockService";

class AddStockComponent extends Component {

    constructor(props) {
        super(props);
        this.state = {
            name: '',
            itemcode: '',
            supplier: '',
            amountremaining: '',
            unitprice: ''
        }
    }

    saveStock = (event) => {
        event.preventDefault();
        let stock = {
            name: this.state.name,
            itemcode: this.state.itemcode,
            supplier: this.state.supplier,
            amountremaining: this.state.amountremaining,
            unitprice: this.state.unitprice
        };
        console.log('Stock => ' + JSON.stringify(stock));

        StockService.addStock(stock).then(res => {
            this.props.history.push('/stocks');
        });
    }

    changeNameHandler = (event) => {
        this.setState({name: event.target.value});
    }
    changeItemCodeHandler = (event) => {
        this.setState({itemcode: event.target.value});
    }
    changeSupplierHandler = (event) => {
        this.setState({supplier: event.target.value});
    }
    changeAmountremainingHandler = (event) => {
        this.setState({amountremaining: event.target.value});
    }
    changeUnitPriceHandler = (event) => {
        this.setState({unitprice: event.target.value});
    }

    handleValidation(){
        let fields = this.state.fields;
        let errors = {};
        let formIsValid = true;

        //Name
        if(!fields["name"]){
            formIsValid = false;
            errors["name"] = "Cannot be empty";
        }

        if(typeof fields["name"] !== "undefined"){
            if(!fields["name"].match(/^[a-zA-Z]+$/)){
                formIsValid = false;
                errors["name"] = "Only letters";
            }
        }

        this.setState({errors: errors});
        return formIsValid;
    }

    contactSubmit(e){
        e.preventDefault();

        if(this.handleValidation()){
            alert("Form submitted");
        }else{
            alert("Form has errors.")
        }

    }

    handleChange(field, e){
        let fields = this.state.fields;
        fields[field] = e.target.value;
        this.setState({fields});
    }

    cancel() {
        this.props.history.push('/stocks');
    }

    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="card col-md-6 offset-md-3">
                        <h3 className="text-center">Stock Registration Page</h3>
                        <div className="card-body">
                            <form action="signup">
                                <div className="form-group">
                                    <label>Stock Name </label>
                                    <input type="text" placeholder="User Name" name="userName"
                                           className="form-control" required
                                           value={this.state.username} onChange={this.changeUsernamehandler}/>
                                </div>
                                <div className="form-group">
                                    <label>Email </label>
                                    <input type="text" placeholder="Email" name="email"
                                           className="form-control" required
                                           value={this.state.email} onChange={this.changeEmailhandler}/>
                                </div>
                                <div className="form-group">
                                    <label>Password </label>
                                    <input type="text" placeholder="Password" name="password"
                                           className="form-control" required
                                           value={this.state.password} onChange={this.changePasswordhandler}/>
                                </div>
                                <div className="form-group">
                                    <label>Telephone </label>
                                    <input type="text" placeholder="Telephone Number" name="telephone"
                                           className="form-control" maxLength="10" required
                                           value={this.state.telephone} onChange={this.changeTelephonehandler}/>
                                </div>
                                <button className="Btn btn-success" onClick={this.saveUser}>Save</button>
                                <button className="Btn btn-danger" onClick={this.cancel.bind(this)}
                                        style={{marginLeft: "10px"}}>Cancel
                                </button>
                            </form>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default AddStockComponent;
